const url = "http://localhost:3000/api/v1/stocks";
const options = {
  method: "GET",
  headers: {
    Accept: "application/json",
    "Content-Type": "application/json;charset=UTF-8",
  },
};

const fetchData = () => {
  fetch(url, options)
  .then((response) => {
    if (!response.ok) {
      throw new Error("Error: " + response.status);
    }
    return response.json();
  })
};

export default fetchData;
